                        <span>101</span>
                    </div>
                </div>
                <div className="box">
                    <i className="fas fa-table"></i>
                    <div className="data">
                    <FontAwesomeIcon icon={faHouse} />
                        <p>product</p>
                        <span>{allinfo.count_product}</span>
                    </div>
                </div>
            </div>
            <h5>Recent Tickets</h5>
            <table>
                <thead>
                    <tr>
                        <th>Name </th>
                        <th>Description</th>
                        <th>Status</th>
                        <th>Action</th>
                        {/* Add more columns if needed */}
                    </tr>
                </thead>
                <tbody>
                    {latest_tik.map((item) => (
                        <tr key={item.id}>
                            <td>{item.name}</td>
                            <td>{item.description}</td>
                            <td>{item.status}</td>
                            <td>
                            <FontAwesomeIcon icon={faEye} />
                            </td>
                        </tr>
                        ))}
                </tbody>
            </table>
            <div className="data-info">
                <div className="box">
                    <i className="fas fa-user"></i>
                    <div className="data">
                    <FontAwesomeIcon icon={faTicket} />
                        <p>Open Tickets</p>
                        <span>{statsData.count_users}</span>
