                </div>
                <div className="box">
                    <i className="fas fa-pen"></i>
                    <div className="data">
                    <FontAwesomeIcon icon={faTicket} />
                        <p>Pending Tickets</p>
                        <span>101</span>
                    </div>
                </div>
                <div className="box">
                    <i className="fas fa-table"></i>
                    <div className="data">
                    <FontAwesomeIcon icon={faTicket} />
                        <p>Closed Ticket</p>
                        <span>{statsData.count_product}</span>
                    </div>
                </div>
            </div>

        </div>
    </>
);
};

